syntax = "proto3";
package kiemtran.kiemtran;

import "amino/amino.proto";
import "gogoproto/gogo.proto";
import "kiemtran/kiemtran/params.proto";

option go_package = "kiemtran/x/kiemtran/types";

// GenesisState defines the kiemtran module's genesis state.
message GenesisState {
  // params defines all the parameters of the module.
  Params params = 1 [
    (gogoproto.nullable) = false,
    (amino.dont_omitempty) = true
  ];
}
